import React from 'react'

export default function Photo({ photo, onEdit, onDelete }) {
  return (
    <div style={{ margin: '10px', border: '1px solid black', padding: '10px' }}>
    <img src={`http://localhost:3001/${photo.path}`} alt={photo.title} style={{ width: '100px',height:'100px' }} />
    <h3>{photo.title}</h3>
    <p>{photo.description}</p>
    <button onClick={() => onEdit(photo)}>Edit</button>
    <button onClick={() => onDelete(photo._id)}>Delete</button>
  </div>
  )
}
